script: |
  super -f text -I q13659.spq | sort > q13659.out

inputs:
  - name: q13659.spq
    data: |
      SELECT ALL + CAST ( NULL AS INTEGER ) AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col2 < - - 4 + - col0 * CAST ( NULL AS REAL ) * + + col2;
  - name: tab2

outputs:
  - name: q13659.out
    data: |
